import Overview from "./Overview";
import Repositories from "./Repositories";
import Projects from "./Projects";
import React, { useState } from 'react';

const Navbar = () => {

    const [sel, setSel] = useState(false) as any

    const handleClick = () => {
        setSel(true)
    }

    return (

        
            <nav style={{ marginRight: '130px' }} className=" flex justify-center z-20 ">
                <Overview />
                <Repositories isS={sel} onClick={() => handleClick()}/>
                <Projects />
            </nav>
        

    )
}
export default Navbar;
//max-md:justify-around
